import React from 'react'
import {
    AboutMeContainer,
    AboutMeImgContainer,
    AboutMeImage,
} from './AboutMeElements'

const AboutMe = ({ img }) => {
    return (
        <AboutMeContainer>
            <AboutMeImgContainer>
                <AboutMeImage alt="AboutMeImage" src={img} />
            </AboutMeImgContainer>
        </AboutMeContainer>
    )
}

export default AboutMe
